import React from "react";
import * as S from "./styled";
import { Heading3, Text } from "components/common/Text";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import ImageHamburger from "images/hamburger-icon.png";
import ImageHotPot from "images/hamburger-icon.png";
import ImageBiBimMap from "images/hamburger-icon.png";
import ImageRamen from "images/hamburger-icon.png";
import ImageSalad from "images/hamburger-icon.png";
import ImagePizza from "images/pizza-icon.jpg";

export default function DishesList() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 5,
    slidesToScroll: 1,
  };
  return (
    <div className="container">
      <S.WrapDishesList>
        <div className="row">
          <div className="col-md-12">
            <S.WrapText>
              <Heading3 padding="40px 0px 0px 0px" size="30px">
                We Provider Delivery Within 30 Min
              </Heading3>
              <Text isGrey>
                Wellcome to the Biggest Network of Food Ordering & Delivery
              </Text>
            </S.WrapText>
          </div>
          <div className="col-md-12">
            <Slider {...settings}>
              <div>
                <h3>1</h3>
              </div>
              <div>
                <h3>2</h3>
              </div>
              <div>
                <h3>3</h3>
              </div>
              <div>
                <h3>4</h3>
              </div>
              <div>
                <h3>5</h3>
              </div>
              <div>
                <h3>6</h3>
              </div>
            </Slider>
          </div>
        </div>
      </S.WrapDishesList>
    </div>
  );
}
